import{_ as t,o as e,c as r,S as l}from"./chunks/framework.59c3ae61.js";const f=JSON.parse('{"title":"src 和 href 的区别","description":"","frontmatter":{"isTimeLine":true,"title":"src 和 href 的区别","date":"2023-9-19","tags":["面试经验","Html"],"categories":["面试经验"]},"headers":[],"relativePath":"interview/html/src和href的区别.md","filePath":"interview/html/src和href的区别.md","lastUpdated":1712394160000}'),s={name:"interview/html/src和href的区别.md"},c=l('<h1 id="src-和-href-的区别" tabindex="-1">src 和 href 的区别 <a class="header-anchor" href="#src-和-href-的区别" aria-label="Permalink to &quot;src 和 href 的区别&quot;">​</a></h1><p>src 和 href 是 Html 中两个常用的属性，它们常用于指定资源的位置或链接。</p><p>二者虽然在语法上相似，但在用法和功能上存在差异。</p><p>从用法上看：</p><p><strong><code>src</code> 属性用于嵌入外部资源（比如脚本、图像、音频、视频等）到 Html 中。</strong></p><p>例如：</p><ul><li><code>&lt;script src=&quot;script.js&quot;&gt;&lt;/script&gt;</code></li></ul><p>用于在 Html 中嵌入外部的 JavaScript 文件，浏览器会下载并执行该脚本文件。</p><ul><li><code>&lt;img src=&quot;image.png&quot;&gt;</code></li></ul><p>用于在 Html 中嵌入外部的图片，浏览器会根据指定的 <code>src</code> 值下载并显示该图片。</p><p><strong><code>href</code> 属性用于创建超链接和加载样式表。</strong></p><p>例如:</p><ul><li><code>&lt;a href=&quot;https://www.baidu.com&quot;&gt;baidu&lt;/a&gt;</code></li></ul><p>用于创建超链接，将文本或图片转换为可点击的链接。用户点击后，浏览器会跳转到指定的 URL。</p><ul><li><code>&lt;link href=&quot;style.css&quot; rel=&quot;stylesheet&quot;&gt;</code></li></ul><p>用于加载外部样式表文件，用于定义文档的样式和布局。</p><p>二者的区别在于：</p><p><strong>src</strong>:</p><ul><li><p>src 属性用于指定要嵌入到 Html 中的外部资源的位置。</p></li><li><p>src 属性会影响文档的解析和显示过程。导致<em>浏览器暂停文档解析</em>，开始下载并执行或显示指定的资源。</p></li><li><p>src 属性常用于脚本、图像、音频、视频等元素。</p></li></ul><p><strong>href</strong>:</p><ul><li><p>href 属性用于指定超链接的目标资源的位置，浏览器识别到它指向的文件后，会并行加载该文件，不会停止对当前文档的处理。</p></li><li><p>href 属性用于创建可点击的超链接或加载外部样式表文件。</p></li><li><p>href 属性常用于锚点元素（a标签）和链接样式表的link元素。</p></li><li><p>href 属性的资源通常是通过用户交互来加载和显示的。</p></li></ul>',21),i=[c];function o(p,a,n,d,h,u){return e(),r("div",null,i)}const m=t(s,[["render",o]]);export{f as __pageData,m as default};
